import { BrowserRouter as Router} from "react-router-dom";
import Navbar from "./components/Navbar/Navbar";
//import card from "./src/components/Card";

class App extends Component {
    render() {
        return (
            <Router>
                <div>
                    <Navbar />
                </div>
            </Router>
        )
    }
}



export default App;
